import { TRYTE_WIDTH, trytesToTrits, valueToTrits } from '@iota/converter'
import { address, digests, FRAGMENT_LENGTH, key, subseed } from '@iota/signing'

export const seed = trytesToTrits('THIS9IS9THE9BEST9OF9ALL9POSSIBLE9WORLDS')
export const securityLevel = 2
export const signaturesOrMessages = [
    trytesToTrits('M' + '9'.repeat(FRAGMENT_LENGTH / TRYTE_WIDTH - 1)),
    trytesToTrits(
        '9'.repeat((FRAGMENT_LENGTH / TRYTE_WIDTH) * securityLevel) +
            'M' +
            '9'.repeat(FRAGMENT_LENGTH / TRYTE_WIDTH - 1)
    ),
    trytesToTrits('9'.repeat(FRAGMENT_LENGTH / TRYTE_WIDTH)),
]
export const addresses = [
    address(digests(key(subseed(seed, 1), securityLevel))),
    address(digests(key(subseed(seed, 0), securityLevel))),
    address(digests(key(subseed(seed, 2), securityLevel))),
]
export const values = [valueToTrits(1), valueToTrits(-2), valueToTrits(1)]
export const issuanceTimestamp = valueToTrits(1553876118)
export const tag = trytesToTrits('T')
export const obsoleteTag = tag

export const interimBundle = trytesToTrits(
    ''
)

export const finalBundle = trytesToTrits(
    ''
)

export const finalSignedBundle = trytesToTrits(
    ''
)
